import React from "react";

function LoginSignup() {
  return (
    <div className="Navbar fixed top-0 left-0 w-full bg-white shadow-md z-10">
      <div className="flex justify-between items-center h-16 mx-8">
        <div className="text-lg font-bold">WineAI</div>
        <div>
          <button className="bg-gray-700 text-white py-2 px-4 rounded mr-4">
            Login
          </button>
          <button className="bg-gray-700 text-white py-2 px-4 rounded">
            Signup
          </button>
        </div>
      </div>
    </div>
  );
}

export default LoginSignup;
